import React from 'react';
import { Link } from 'react-router-dom';
import Logo from '../../assets/logo.png';

function Navbar() {
  return (
    <nav className="navbar bg-primary px-3" data-bs-theme="dark">
      <div className="container-fluid d-flex justify-content-between align-items-center">
      <span className="navbar-brand fw-bold fs-3" style={{ letterSpacing: '2px', fontFamily: 'monospace' }}>
          MEEWOO
        </span>
      <div className="d-flex gap-2">
          <Link to="/" className="btn btn-outline-light" >Home</Link>
          <Link to="/customer" className="btn btn-outline-light">Customer Booth</Link>
          <Link to="/employee" className="btn btn-outline-light">Employee Booth</Link>
          <Link to="/admin" className="btn btn-outline-light">Admin Booth</Link>
        </div>
      </div>
    </nav>
  );
}

export default Navbar;
